#include <string.h>
#include <stdio.h>
#include <stdlib.h>

void printString(char* str) {
    for (int i = 0; i < strlen(str); i++) {
        printf("%c", str[i]);
    }
    printf("Done\n");
}

int main(int argc, char** argv) {
    
    char* strShort = { "hello world" };

    // string of length 1 million
    char *strLong = { " " };
    
    printString(strShort);
    
}